import React from "react";
import { Input, Card } from "antd";

const { Search } = Input;

export const SeachBar = (props) => {
  return (
    <Card style={{ width: 600 }}>
      <Search
        onChange={props.handleChange}
        onPressEnter={props.handleSubmit}
        onSearch={props.handleSubmit}
        enterButton
        size="large"
        type="text"
        style={{
          position: "fixed",
          top: 70,
          display: "flex",
        }}
      />
    </Card>
  );
};
